window.bookSummaryJSON = "<p>What the king wants, he gets, and what the king wants right now is me. On my knees. </p> <p>Maximo Giovanni Santaro is a king. A real king, like in the old days. The kind I didn’t know still existed. The kind who commands obedience and punishes any hint of defiance from his subjects. </p> <p>His Majesty doesn’t take no for an answer, and refusing his royal command has earned me not just a spanking that will leave me sobbing, but a lesson so utterly shameful, that it will serve as an example for anyone else who might dare to disobey him. I will beg and plead as one brutal, screaming climax after another ravages my quivering body, but there will be no mercy for me. </p> <p>He’s not going to stop until he’s taught me that my rightful place is at his feet, blushing and sore.</p>"; 
